import React, { Component } from 'react'

export default class Filter extends Component {
    render(props) {
        return (
            <div>
                <div className="filter-result">{this.props.count}</div>
                <div className="filter-sort">Order</div>
                <div className="filter-result">Filter</div>
            </div>
        )
    }
}
